import React from "react";

class Login extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      buttonText: "Login",
      loginText: "Enter username",
      passwordText: "Enter password",

      loginValue: "",
      passwordValue: "a",
    };
  }

  render() {
    console.log(this.state.passwordValue);
    return (
      <div>
        <button>{this.state.buttonText}</button>
        <form>{this.state.loginText}</form>
        <form>{this.state.passwordText}</form>
      </div>
    );
  }
}

export default Login;
